

class Solution:
    def getWinner(self, arr: list[int], k: int) -> int:

        arr = arr.copy()
        
        streak = 0
        
        current_winner = None

        count = 0

        if k >= len(arr):
            arr.sort()
            return arr[-1]
    
        while streak < k:

            if arr[0] < arr[1]:

                streak = 1
                current_winner = arr[1]
                arr = self.move_to_end(arr, pos=0)
                
            elif arr[0] > arr[1]:
                if current_winner == arr[0]: streak += 1
                elif current_winner != arr[0]: 
                    streak = 1
                    current_winner = arr[0]
               
                arr = self.move_to_end(arr, 1)
            
            count += 1
            print(f"at streak = {streak} & count = {count}")
        
        print()
        return arr[0]
        

    def move_to_end(self, l: list[int], pos: int) -> list[int]:
        l = l.copy()
        buff_item = l[pos]
        del l[pos]

        l.append(buff_item)
        return l
    
